{"post_stream":{"posts":[{"id":3567419,"name":"Kirby Caldwell","username":"KirbyC_1","avatar_template":"/letter_avatar_proxy/v4/letter/k/a87d85/{size}.png","created_at":"2025-03-24T21:43:13.056Z","cooked":"<p>So I am looking to use pathplanner for our district event, I’ve looked at the docs and it says that I need " The following examples will assume that your drive subsystem has the following methods:</p>
<ul>
<li><code>getPose</code> - Returns the current robot pose as a <code>Pose2d</code></li>
<li><code>resetPose</code> - Resets the robot’s odometry to the given pose</li>
<li><code>getRobotRelativeSpeeds</code> or <code>getCurrentSpeeds</code> - Returns the current robot-relative <code>ChassisSpeeds</code>. This can be calculated using one of WPILib’s drive kinematics classes</li>
<li><code>driveRobotRelative</code> or <code>drive</code> - Outputs commands to the robot’s drive motors given robot-relative <code>ChassisSpeeds</code>. This can be converted to module states or wheel speeds using WPILib’s drive kinematics classes."</li>
</ul>
<p>I will list my current drive subsystem code in the reply below.</p>","post_number":1,"post_type":1,"posts_count":4,"updated_at":"2025-03-24T21:43:13.056Z","reply_count":0,"reply_to_post_number":null,"quote_count":0,"incoming_link_count":3,"reads":56,"readers_count":55,"score":26.2,"yours":false,"topic_id":496789,"topic_slug":"how-do-i-implement-the-required-values-pathplanner-says-i-need-into-my-drive-subsystem","display_username":"Kirby Caldwell","primary_group_name":null,"flair_name":null,"flair_url":null,"flair_bg_color":null,"flair_color":null,"flair_group_id":null,"badges_granted":[],"version":1,"can_edit":false,"can_delete":false,"can_recover":false,"can_see_hidden_post":true,"can_wiki":false,"read":true,"user_title":null,"bookmarked":false,"actions_summary":[],"moderator":false,"admin":false,"staff":false,"user_id":72110,"hidden":false,"trust_level":2,"deleted_at":null,"user_deleted":false,"edit_reason":null,"can_view_edit_history":true,"wiki":false,"user_custom_fields":{"user_field_4":"Programmer/Technician"},"post_url":"/t/how-do-i-implement-the-required-values-pathplanner-says-i-need-into-my-drive-subsystem/496789/1","reactions":[],"current_user_reaction":null,"reaction_users_count":0,"current_user_used_main_reaction":false,"can_accept_answer":false,"can_unaccept_answer":false,"accepted_answer":false,"topic_accepted_answer":null},{"id":3567420,"name":"Kirby Caldwell","username":"KirbyC_1","avatar_template":"/letter_avatar_proxy/v4/letter/k/a87d85/{size}.png","created_at":"2025-03-24T21:43:22.612Z","cooked":"<pre><code class="lang-auto">// Copyright (c) FIRST and other WPILib contributors.
